import React from 'react';
import '../node_modules/font-awesome/css/font-awesome.min.css'; 

const ToDoList = (props) => {
    return (
    <>
    <div className="todo_style">
    <i class="fa-solid fa-circle-xmark"></i>
    <li> {props.text} </li>
    </div>
    </>
    );
}

export default ToDoList;
